import React from "react";
import styled from "styled-components";
const detailModalElem = document.getElementById("detail-modal");

const Detail = () => {
  return ReactDOM.createPortal(
    <DetailModal id="refresh-modal">
      <button onClick={() => refresh()}>refresh</button>
      <button onClick={_ => dispatch({ type: "CLEAR_REGION" })}>reset region</button>
      <button onClick={_ => dispatch({ type: "CLEAR_PERSONALITY" })}>reset personality</button>
      <button onClick={_ => toggleShowFavorites()}>reset personality</button>
    </DetailModal>,
    detailModalElem
  );
};

export default Detail;

const DetailModal = styled.div`
  position: absolute;
  width: 500px;
  height: 700px;
  border: 1px red solid;
  top: 50%;
  left: 50%;
`;
